import './App.css';
import { Heading, Box } from "@chakra-ui/react"

function App() {
  return (
    <Box>
      <Heading as="h1" noOfLines={1}>
        Todo List
      </Heading>
      <form>
        <input 
          placeholder='Enter your input here' 
          autoFocus
          />
        <button>Submit</button>
      </form>
    </Box>


    );
}

export default App;
